import { countries } from "../countries.js";
import { apiKey } from "../apikey";
import fetch from "isomorphic-unfetch";

const Index = props => (
  <div>
    <select name="countries" className="countries-dropdown"></select>
    {countries.map(country => {
      return <p>{country}</p>;
    })}
    <p>{apiKey}</p>
  </div>
);

export default Index;
